// frontend/src/components/Cart.js
import React, { useState } from "react";
import { useCart } from "../context/CartContext";
import axios from "axios";

export default function Cart({ token }) {
  const { cart, clearCart } = useCart();
  const [msg, setMsg] = useState("");
  const [showFeedback, setShowFeedback] = useState(false);
  const [feedback, setFeedback] = useState({ rating: 5, comments: "" });
  const [lastOrderId, setLastOrderId] = useState(null);

  if (!cart.length)
    return <h3 style={{ textAlign: "center" }}>Your cart is empty</h3>;

  const total = cart.reduce((sum, item) => sum + item.price, 0);

  async function placeOrder() {
    setMsg("");
    try {
      const res = await axios.post(
        "http://localhost:5000/api/orders/place",
        { userId: "demoUser", items: cart },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setMsg("Order placed successfully!");
      setLastOrderId(res.data._id);
      setShowFeedback(true);
      clearCart();
    } catch (err) {
      console.error("Order error:", err);
      setMsg("Order failed — please try again.");
    }
  }

  async function submitFeedback(e) {
    e.preventDefault();
    setMsg("");

    if (!lastOrderId) {
      setMsg("No order to attach feedback to.");
      return;
    }

    try {
      await axios.post(
        "http://localhost:5000/api/feedback",
        {
          orderId: lastOrderId,
          userId: "demoUser",
          rating: Number(feedback.rating),
          comments: feedback.comments,
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setMsg("Thanks for the feedback! We’ll use this to improve recommendations.");
      setShowFeedback(false);
      setFeedback({ rating: 5, comments: "" });
    } catch (err) {
      console.error("Feedback error:", err);
      setMsg("Failed to submit feedback. Try again later.");
    }
  }

  return (
    <div className="page-container">
      <h2>Your Cart</h2>

      {msg && <div style={{ marginBottom: 12 }} className="inline-msg">{msg}</div>}

      {cart.map((item, i) => (
        <div key={i} className="cart-item">
          <div>
            <div style={{ fontWeight: 700 }}>{item.name}</div>
            <div className="small-muted">{item.restaurantName}</div>
          </div>
          <div>₹ {item.price}</div>
        </div>
      ))}

      <h3 style={{ marginTop: 10 }}>Total: ₹ {total}</h3>

      <div style={{ display: "flex", gap: 10, marginTop: 12 }}>
        <button className="primary-btn" onClick={placeOrder}>Place Order</button>
        <button onClick={clearCart} style={{ background: "#efefef", border: "none", padding: "10px 14px", borderRadius: 8 }}>
          Clear
        </button>
      </div>

      {/* Feedback form appears immediately after order */}
      {showFeedback && (
        <form onSubmit={submitFeedback} style={{ marginTop: 18, textAlign: "left", maxWidth: 640 }}>
          <h3>Quick feedback — help improve recommendations</h3>
          <label style={{ display: "block", marginBottom: 6 }}>Rating (1-5)</label>
          <select value={feedback.rating} onChange={(e) => setFeedback({ ...feedback, rating: e.target.value })}>
            <option value={5}>5 — Loved it</option>
            <option value={4}>4 — Liked</option>
            <option value={3}>3 — Neutral</option>
            <option value={2}>2 — Disliked</option>
            <option value={1}>1 — Bad</option>
          </select>

          <label style={{ display: "block", marginTop: 10 }}>Comments (optional)</label>
          <textarea value={feedback.comments} onChange={(e) => setFeedback({ ...feedback, comments: e.target.value })} style={{ width: "100%", minHeight: 80, marginTop: 6, padding: 8 }} />

          <div style={{ marginTop: 10 }}>
            <button className="primary-btn" type="submit">Submit Feedback</button>
          </div>
        </form>
      )}
    </div>
  );
}
